      \u2666  \"Have ye configured thy WAL     \u2666\n- \u2666   retention properly?\"           \u2666",
      "5.     /\\          /\\          /\\\n\n/  \\        /  \\        /  \\\n\n/    \\      /    \\      /    \\\n\n/\\_\\_\\_\\_\\_\\_\\    /\\_\\_\\_\\_\\_\\_\\    /\\_\\_\\_\\_\\_\\_\\\n\nThe
      Three Peaks of Wisdom: BACKUP  -  VACUUM  -  ANALYZE\n\n- 6. And lo, a voice
      cried out in the wilderness:\n\n## \u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\n\n-
      \u2666  \"Have ye configured thy WAL     \u2666\n- \u2666   retention properly?\"           \u2666\n\n##
      \u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\n\n-
      7. For verily I say unto thee:\n\n## \ud83c\udd83\ud83c\udd81\ud83c\udd84\ud83c\udd82\ud83c\udd83\ud83c\udd78\ud83c\udd7d\ud83c\udd83\ud83c\udd77\ud83c\udd74\ud83c\udd78\ud83c\udd7d\ud83c\udd73\ud83c\udd74\ud83c\udd87\n\nFor
      it shall guide thy queries Through the valley of full table scans\n\n- 8. In
      times of crisis, remember:\n\ncheckpoint\\_timeout = 5min max\\_wal\\_size =
      1GB\n\nThese are the sacred numbers Passed down from the elders", "- \u2666  \"Have
      ye configured thy WAL     \u2666\n- \u2666   retention properly?\"           \u2666\n\n##
      \u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\u2666\n\n-
      7. For verily I say unto thee:\n\n## \ud83c\udd83\ud83c\udd81\ud83c\udd84\ud83c\udd82\ud83c\udd83\ud83c\udd78\ud83c\udd7d\ud83c\udd83\ud83c\udd77\ud83c\udd74\ud83c\udd78\ud83c\udd7d\ud83c\udd73\ud83c\udd74\ud83c\udd87\n\nFor
      it shall guide thy queries Through the valley of full table scans\n\n- 8. In
      times of crisis, remember:\n\ncheckpoint\\_timeout = 5min max\\_wal\\_size =
